</g>
<g transform="matrix(1 0 0 1 317.55 417.03)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-120.05 y=-5.46 style=white-space:pre>OK, fine. But what is persistence, </tspan><tspan x=-120.05 y=15.51>oh fine and noble professor?</tspan></text>
</g>
<g transform="matrix(1 0 0 1 319.26 307.51)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-123.76 y=-15.95 style=white-space:pre>No. Just three, young student. </tspan><tspan x=-123.76 y=5.03 style=white-space:pre>Just three. Trying to keep it simple </tspan><tspan x=-123.76 y=26>here.</tspan></text>

<g transform="matrix(1 0 0 1 328.67 118.51)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-111.17 y=-15.95 style=white-space:pre>I was going to say apple, from </tspan><tspan x=-111.17 y=5.03 style=white-space:pre>an apple tree. Oh well; we’ll do </tspan><tspan x=-111.17 y=26>it your way, I guess.</tspan></text>
</g>
<g transform="matrix(1 0 0 1 267.74 224.54)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-54.24 y=5.03>(stares blankly)</tspan></text>

<g transform="matrix(1 0 0 1 316.66 364.97)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-127.16 y=-47.41 style=white-space:pre>Anyhow, you pick a peach; in fact, </tspan><tspan x=-127.16 y=-26.43 style=white-space:pre>you pick many many peaches, but </tspan><tspan x=-127.16 y=-5.46 style=white-space:pre>you want to make them last for a </tspan><tspan x=-127.16 y=15.51 style=white-space:pre>long time. Winter is hard and cruel </tspan><tspan x=-127.16 y=36.49 style=white-space:pre>in Wisconsin, after all. What do you </tspan><tspan x=-127.16 y=57.46>do?</tspan></text>
</g>
<g transform="matrix(1 0 0 1 327.33 544)">
		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-137.83 y=-26.43 style=white-space:pre>Well, I think there are some different </tspan><tspan x=-137.83 y=-5.46 style=white-space:pre>things you can do. You can pickle it! </tspan><tspan x=-137.83 y=15.51 style=white-space:pre>Or bake a pie. Or make a jam of some </tspan><tspan x=-137.83 y=36.49>kind. Lots of fun!</tspan></text>
</g>

		<text xml:space=preserve font-family=helvetica font-size=16 font-weight=normal style=stroke:none;stroke-width:1;stroke-dasharray:none;stroke-linecap:butt;stroke-dashoffset:0;stroke-linejoin:miter;stroke-miterlimit:10;fill:rgb(0,0,0);fill-rule:nonzero;opacity:1;white-space:pre><tspan x=-158.78 y=-57.89 style=white-space:pre>Fun? Well, maybe. Certainly, you have </tspan><tspan x=-158.78 y=-36.92 style=white-space:pre>to do a lot more work to make the peach </tspan><tspan x=-158.78 y=-15.95 style=white-space:pre>persist. And so it is with information as </tspan><tspan x=-158.78 y=5.03 style=white-space:pre>well; making information persist, despite </tspan><tspan x=-158.78 y=26 style=white-space:pre>computer crashes, disk failures, or power </tspan><tspan x=-158.78 y=46.97>outages is a tough and interesting challenge.</tspan></text>
